"use strict";

var PAGE = {
  data: {
    phone: null,
    url: 'https://www.jevescript.com/api/task/mobile'
  },
  init: function init() {
    this.bind();
  },
  bind: function bind() {
    $(".button").on("click", this.clickbutton);
  },
  clickbutton: function clickbutton() {
    var value = $('.num-input').val().trim();
    var reg = new RegExp(/^1[3456789]\d{9}$/);

    if (reg.test(value)) {
      PAGE.data.phone = value;
      alert("申请成功");
      $('.false-hint').css('display', 'none');
      $('.num-input').val('');
    } else {
      $('.false-hint').css('display', 'block');
    }
  }
};
PAGE.init();
